import {
  FormControl,
  Button,
  FormGroup,
  Navbar,
  NavItem,
  Container,
  Image,
  ButtonGroup,
  Nav,
  Form,
} from "react-bootstrap";
import * as FaIcons from 'react-icons/fa';
import 'bootstrap/dist/css/bootstrap.css';
//import classes from "./NavigBar.module.css";
//import './NavigBar.css'
function NavigBar() {
  return (
    <div>
       <Navbar bg='light'>
           <container>
           <Nav>
             <FaIcons.FaBars/>
         </Nav>
         <Nav>
             <Navbar.Brand>Uber Eats</Navbar.Brand>
         </Nav>
           </container>





       </Navbar>
    </div>
  );
}
export default NavigBar;
